【仕様】DC12V 専用/ 容量：150ｗ<br />
【寸法】 商品画像をご確認ください。 <br />
【商品内容】1セット1個入り<br />
【保証期間】発送日より、3ヶ月間 <br />
【初期不良対応期間】発送日より、7営業日まで<br />
<br />
【商品について】<br />
・お車1台に対し、ICウィンカーリレー1個で対応可能。<br />
・最新型！ウィンカー点滅速度の調整が可能。<br />
・調整ネジによる点滅速度の調整が可能。<br />
・アンサーバック対応。 (※車種ごとにコントロールが異なるため、一部の車種において、機能しない場合がございます。）<br />
・ウィンカー作動時のカチカチ音のスピーカー内臓。<br />
<br />
【適応車種】<br />
トヨタ・ダイハツ・スズキ・スバル・三菱等の8ピンタイプの車両。<br />
※輸入車には適応しておりません。<br />
<br />
【対応範囲】<br />
フロントハロゲン球＋リアハロゲン球の場合<br />
フロントハロゲン球＋リアLED球の場合<br />
フロントLED球＋リアハロゲン球の場合<br />
フロントLED球＋リアLED球の場合<br />
<br />
【注意事項】<br />
※対応範囲は参考です。上記の適応車種であっても、稀にお取付できない場合がございます。<br />
※商品説明の形状をご確認の上、ご購入下さい。<br />
※車種ごとにコントロールが異なるため、一部の車種において、追加機能が正常に動作しない場合がございます。<!---------------------ここから「お買い物カゴ」--------------------->
