【仕様】DC12V 50w6Ω<br />
【商品内容】<br />
　(1)抵抗器2個<br />
　(2)タップ4個<br />
【保証期間】発送日より、3ヶ月間 <br />
【初期不良対応期間】発送日より、7営業日まで<br />
<br />
【商品について】<br />
・ウインカーランプを純正球からLEDのバルブに変更した際に起こる ハイフラッシャー（ハイフラ）を防止する6Ωメタルクラッド抵抗器です。<br /><br />
・素材は放熱効果に優れたアルミ製ヒートシンクを採用。 高品質で、安定した精度を誇ります。<br />
・タップ付属だから、ペンチ1本で取付簡単！<br />
・一部の車種ではICウインカーリレーでの対応ができない場合があります。ICウインカーリレー非対応の車両には、こちらの抵抗器をお試し下さい。<br />
・ウィンカーバルブ１球につき、抵抗器1個必要となります。<br />
・車一台ウインカー（フロント＋リア）の場合、抵抗器4個必要になります。<br />
・全車種対応　※ごく稀に、車種によって、抵抗器を接続しても、症状が改善されない場合があります。 <br />
<br />
【注意事項】<br />
・取付は、ボディ側に取付けて下さい。<br />
・長時間使用の場合、抵抗器本体は高温になるため、電気配線、プラスチック類に接触しないよう1cm離して取付け下さい。<br />
・長時間使用は、高温になるため、手を触れないで下さい。<br />
<br />
